import styled from 'styled-components'

export const Container = styled.div`
    height: 100px;
    width: 96vw;
    border: 1px solid black;
    display: flex;

    align-items: center;
    top: 0;
    position: sticky;
`
export const Left = styled.div``
export const Center = styled.div``
export const Right = styled.div``
